import React, {Component} from 'react';
import {BrowserRouter} from "react-router-dom";
import Home from './Pages/Home';

class App extends Component {
    render() {

        State= {
            Header:[
                {
                    id: 1,
                    title: 'BEGELEIDING'
                },
                {
                    id: 2,
                    title: 'PROFESSIONALS'
                },
                {
                    id: 3,
                    title: 'INFORMATIE'
                },
                {
                    id: 4,
                    title: 'CONTACT'
                }

            ]
        }
        return (
            <BrowserRouter>
                <div className="App">
                    <Home/>
                </div>
            </BrowserRouter>
        );
    }
}

export default App;
